description:
**BI Analist**

 **VUE BIOSCOPEN**



Vue Cinemas BV is de op één na grootste commerciële bioscoopexploitant van Nederland en exploiteert momenteel 20 bioscopen verspreid over Nederland. In december opent Vue een nieuwe, ultramoderne bioscoop in Amsterdam. Het hoofdkantoor is gevestigd in Amsterdam Houthavens, vlakbij de binnenkort te openen 21e VUE NL bioscoop in Amsterdam



Bij Vue Cinemas hebben we één missie: het leveren van de beste selectie content gecombineerd met de nieuwste technologie in de meest indrukwekkende omgeving. Groei en innovatie staan hier centraal in. Ons geheim? Ons getalenteerde team van gemotiveerde en enthousiaste medewerkers. Door altijd een stapje extra te zetten, bieden ze bezoekers de ultieme filmervaring die ze niet snel zullen vergeten. Vanaf het moment dat bezoekers binnenkomen tot ze vertrekken, verwennen we onze gasten. Het beste beeld, geluid en de meest comfortabele stoelen.



Vue Nederland maakt deel uit van Vue International, de grootste bioscoopgroep buiten de Verenigde Staten en een van de belangrijkste spelers op de markt voor grote schermentertainment. Vue International is een van 's werelds toonaangevende bioscoopexploitanten en beheert de meest gerespecteerde merken in grote Europese filmmarkten, verspreid over acht landen, 222 locaties en 1\.951 zalen.

 **Werkwijze**


Door het BI\-landschap van Vue NL te onderhouden en te ontwikkelen, ondersteun je als Power BI\-analist operationele analyse\- en planningsprocessen, informatiestromen en maak je effectieve metingen van bedrijfsprestaties mogelijk.


Onder leiding van de FP\&A\-manager is je doel om een sterke BI\-basis te vestigen voor effectievere en efficiëntere bedrijfsbesturing. Je verbetert managementrapportages (momenteel in PowerBI en vooral MsExcel), verbetert de budgettering en operationele (voornamelijk toelatingsprognoses en theaterpersoneelsuren) prognoseprocessen.

 **VERANTWOORDELIJKHEDEN**

**Onderhoud van het BI\-systeem:**

* Zorg dragen voor naukeurige data, integriteit en governance.
* Verwerk data uit verschillende bronnen (SQL, cloudservices, Excel) met Power Query en SQL.
* Bouwen van robuuste datamodellen en implementeer complexe DAX\-berekeningen voor inzichtelijke analyses;
* Voltooi de replatforming van het SharePoint\-landschap naar de Microsoft Azure Cloud\-omgeving ;
* Ontwerp, ontwikkel en onderhoud interactieve dashboards, rapporten en datavisualisaties met behulp van Microsoft Power BI;
* Automatisering van rapportageprocessen om de efficiëntie te verbeteren.

 **Verbeteren van datastructuren**

* Uitvoeren van trendanalyse ter ondersteuning van strategische beslissingen;
* Samenwerken met interne en externa stakeholders om data te vertalen ter ondersteuning van praktische besluitvorming met betrekking tot openingstijden van theater en planningsrichtlijnen voor theaterpersoneel;
* Uitvoeren van probleemoplossing voor prestatieproblemen en optimalisatie van Power BI\-rapporten en datasets.

 **Profiel**

 **Kwalificaties:**

* 3\-5 jaar ervaring in een data\-analyse of business intelligence\-rol;
* Certificeringen: Microsoft Certified: Power BI Data Analyst Associate\-certificering (PL\-300\) is een pré.

 **Technische kennis \& Ervaring**

* Expertise in Power BI (Desktop, Service, DAX, Data Modelling); Bekendheid met andere MS BI Stack\-tools (SSRS, Azure Data Factory) is een pré;
* Ervaring in een snel, klantgericht multisitebedrijf van vergelijkbare schaal en complexiteit;
* Ervaring met data\-analyse, rapportage of een vergelijkbare BI\-rol;
* Begrijpen van datamodellering en ETL\-concepten;
* Ervaring met SQL;

 **Vaardigheden**

* **Analytisch denkvermogen:** het vermogen om aanbevelingen te doen op basis van data;
* **Prombleemoplossend vermogen**: In staat om problemen identificeren en oplossingen aan te dragen;
* **Commercieel inzicht:** het vermogen om snel kansen met hoog potentieel te identificeren;
* **Communicatie**: Uitstekende communicatieve vaardigheden, met het vermogen om bevindingen duidelijk en vol vertrouwen te presenteren aan belanghebbenden op alle niveaus.
* **Grote aandacht voor detail en nauwkeurigheid**.
* **IT\-vaardigheid**: Office\-suite (uitstekende Excel, PowerPoint, Word)

 **Persoonlijkheid**

* **Prestatiegericht**,
* **Nauwkeurig**
* **Verantwoordelijkheid**
* **Flexibel**
* **Integriteit**
* **Teamsplayer**

